import { Injectable } from '@angular/core';
import { ComplicationAVC } from '../models/ComplicationAVC';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AvcService {

  private apiUrl = 'https://localhost:7129/api/ComplicationAvcs';

  constructor(private http: HttpClient) { }
  addavc(ComplicationAVC: ComplicationAVC): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationAVC);

    return this.http.post<any>(`${this.apiUrl}/addavc`, ComplicationAVC, { observe: 'response' });
  }}
